{
  "translationLines": [
    {
      "lineNumber": 10741,
      "originalJapaneseLine": "「ふん、雑魚が……おっ、サイフ発見」",
      "translatedEnglishLine": "\"Hmph, weaklings... Oh, found a wallet.\""
    },
    {
      "lineNumber": 10742,
      "originalJapaneseLine": "「がはは、意外と持ってたな。ラッキー」",
      "translatedEnglishLine": "\"Gahaha, he actually had something. Lucky!\""
    },
    {
      "lineNumber": 10743,
      "originalJapaneseLine": "「あ……」",
      "translatedEnglishLine": "\"Ah...\""
    },
    {
      "lineNumber": 10744,
      "originalJapaneseLine": "少年にはもう見向きもせずに、",
      "translatedEnglishLine": "Without even glancing back at the boy,"
    },
    {
      "lineNumber": 10745,
      "originalJapaneseLine": "ランスは上機嫌で去っていった。",
      "translatedEnglishLine": "Rance left in a very good mood."
    },
    {
      "lineNumber": 10746,
      "originalJapaneseLine": "「………………」",
      "translatedEnglishLine": "\"..............\""
    },
    {
      "lineNumber": 10747,
      "originalJapaneseLine": "「どうであった、スケさん」",
      "translatedEnglishLine": "\"So, how was it, Suke-san?\""
    },
    {
      "lineNumber": 10748,
      "originalJapaneseLine": "「完全に、どこに出しても恥ずかしいクズでした」",
      "translatedEnglishLine": "\"He was a complete disgrace; an embarrassing trash no matter where you show him.\""
    },
    {
      "lineNumber": 10749,
      "originalJapaneseLine": "「…………うーむ、そうか。困ったものだな」",
      "translatedEnglishLine": "\"...Hmm, I see. That’s troublesome.\""
    },
    {
      "lineNumber": 10750,
      "originalJapaneseLine": "あまり困っていない風で、ガンジーは顎を撫でた。",
      "translatedEnglishLine": "Not seeming too troubled, Gandhi stroked his chin."
    },
    {
      "lineNumber": 10751,
      "originalJapaneseLine": "「取り柄と言えば、強いことくらいで……」",
      "translatedEnglishLine": "\"If I were to say any merit, it’s just that he’s strong...\""
    },
    {
      "lineNumber": 10752,
      "originalJapaneseLine": "「それは必要な事だ。今の時代にはな」",
      "translatedEnglishLine": "\"That’s a necessary thing. In this era, after all.\""
    },
    {
      "lineNumber": 10753,
      "originalJapaneseLine": "「ガンジー様……」",
      "translatedEnglishLine": "\"Lord Gandhi...\""
    },
    {
      "lineNumber": 10754,
      "originalJapaneseLine": "「大事なものは、時代によって違う。",
      "translatedEnglishLine": "\"What’s important differs depending on the era."
    },
    {
      "lineNumber": 10755,
      "originalJapaneseLine": "　優しくあるだけでは、救われぬ者もいる」",
      "translatedEnglishLine": "Simply being kind won’t save some people.\""
    },
    {
      "lineNumber": 10756,
      "originalJapaneseLine": "「よく…………わかりません」",
      "translatedEnglishLine": "\"I don’t really... understand.\""
    },
    {
      "lineNumber": 10757,
      "originalJapaneseLine": "「ま、すぐに結論せねばならぬ訳でもない。",
      "translatedEnglishLine": "\"Well, it’s not like you have to come to a conclusion immediately."
    },
    {
      "lineNumber": 10758,
      "originalJapaneseLine": "　ゆっくり、焦らず考えるのだ」",
      "translatedEnglishLine": "Take your time and think it over without rushing.\""
    },
    {
      "lineNumber": 10759,
      "originalJapaneseLine": "「は、はい……」",
      "translatedEnglishLine": "\"Y-Yes...\""
    },
    {
      "lineNumber": 10760,
      "originalJapaneseLine": "翌日、ランス城――",
      "translatedEnglishLine": "The next day, at Rance Castle—"
    },
    {
      "lineNumber": 10761,
      "originalJapaneseLine": "「お尻たーっち！　がははははは」",
      "translatedEnglishLine": "\"Butt touch! Gahahahaha!\""
    },
    {
      "lineNumber": 10762,
      "originalJapaneseLine": "「わ、きゃ、やめてください、城主様ぁ！」",
      "translatedEnglishLine": "\"W-Wah, please stop, Lord of the Castle!\""
    },
    {
      "lineNumber": 10763,
      "originalJapaneseLine": "「おっ、前よりそれなりに締まってきたな。",
      "translatedEnglishLine": "\"Oh, it’s gotten tighter than before, huh."
    },
    {
      "lineNumber": 10764,
      "originalJapaneseLine": "　がははははは！」",
      "translatedEnglishLine": "Gahahahaha!\""
    },
    {
      "lineNumber": 10765,
      "originalJapaneseLine": "「……あいっかわらず……ロクな事しないな……」",
      "translatedEnglishLine": "\"...As usual... doing nothing decent...\""
    },
    {
      "lineNumber": 10766,
      "originalJapaneseLine": "ウィチタは折を見ては、ランスを尾行していた。",
      "translatedEnglishLine": "Wichita took chances to tail Rance."
    },
    {
      "lineNumber": 10767,
      "originalJapaneseLine": "（どこが英雄なんだ、まったく……）",
      "translatedEnglishLine": "(What’s heroic about him, seriously...)"
    },
    {
      "lineNumber": 10768,
      "originalJapaneseLine": "首を捻るウィチタを余所に、",
      "translatedEnglishLine": "Ignoring Wichita’s puzzled look,"
    },
    {
      "lineNumber": 10769,
      "originalJapaneseLine": "ランスはぶらりと街へ散歩に出ていた。",
      "translatedEnglishLine": "Rance casually set out for a stroll through town."
    },
    {
      "lineNumber": 10770,
      "originalJapaneseLine": "「…………ん？」",
      "translatedEnglishLine": "\"...Huh?\""
    },
    {
      "lineNumber": 10771,
      "originalJapaneseLine": "「おう、おい。今月の分を払ってもらおうか？」",
      "translatedEnglishLine": "\"Hey, hey. How about paying this month’s amount?\""
    },
    {
      "lineNumber": 10772,
      "originalJapaneseLine": "「ううっ、で、ですが、もう……」",
      "translatedEnglishLine": "\"Ugh, b-but, I already...\""
    },
    {
      "lineNumber": 10773,
      "originalJapaneseLine": "「勘違いするなよ。こいつは慰謝料なんだ。",
      "translatedEnglishLine": "\"Don’t get me wrong. This is compensation."
    },
    {
      "lineNumber": 10774,
      "originalJapaneseLine": "　あんたの操縦してたうし車に撥ねられた時は、",
      "translatedEnglishLine": "When I got hit by the ox cart you were driving,"
    },
    {
      "lineNumber": 10775,
      "originalJapaneseLine": "　もうまったく死ぬかと思ったぜ？」",
      "translatedEnglishLine": "I honestly thought I was going to die.\""
    },
    {
      "lineNumber": 10776,
      "originalJapaneseLine": "「ううっ……」",
      "translatedEnglishLine": "\"Ugh...\""
    },
    {
      "lineNumber": 10777,
      "originalJapaneseLine": "（なんだあいつ、あからさまに……",
      "translatedEnglishLine": "(What’s with that guy, blatantly..."
    },
    {
      "lineNumber": 10778,
      "originalJapaneseLine": "　当たり屋か？　でも詳しくは……）",
      "translatedEnglishLine": "Is he a scammer? But I need more details...)"
    },
    {
      "lineNumber": 10779,
      "originalJapaneseLine": "「おい。何やってんだ」",
      "translatedEnglishLine": "\"Hey. What are you doing?\""
    },
    {
      "lineNumber": 10780,
      "originalJapaneseLine": "「ああん？　って、あんたは、ランスさん……！」",
      "translatedEnglishLine": "\"Huh? You’re... Rance-san...!\""
    },
    {
      "lineNumber": 10781,
      "originalJapaneseLine": "「ひっ……」",
      "translatedEnglishLine": "\"Eek...\""
    },
    {
      "lineNumber": 10782,
      "originalJapaneseLine": "「ち、違うんですよ！",
      "translatedEnglishLine": "\"I-it’s not like that!"
    },
    {
      "lineNumber": 10783,
      "originalJapaneseLine": "　俺、こないだうし車に撥ねられて！",
      "translatedEnglishLine": "I got hit by an ox cart the other day!"
    },
    {
      "lineNumber": 10784,
      "originalJapaneseLine": "　それで、生活が……」",
      "translatedEnglishLine": "And because of that, my livelihood…\""
    },
    {
      "lineNumber": 10785,
      "originalJapaneseLine": "「元気そうじゃねえか」",
      "translatedEnglishLine": "\"You look pretty healthy to me.\""
    },
    {
      "lineNumber": 10786,
      "originalJapaneseLine": "「い、いやでも、その間に……」",
      "translatedEnglishLine": "\"N-no, but during that time...\""
    },
    {
      "lineNumber": 10787,
      "originalJapaneseLine": "「やかましいわ」",
      "translatedEnglishLine": "\"Shut up.\""
    },
    {
      "lineNumber": 10788,
      "originalJapaneseLine": "「ぎゃああああああ！？",
      "translatedEnglishLine": "\"Gyaaaaaa!?\""
    },
    {
      "lineNumber": 10789,
      "originalJapaneseLine": "「あっ！？",
      "translatedEnglishLine": "\"Ah!?\""
    },
    {
      "lineNumber": 10790,
      "originalJapaneseLine": "ランスは男をざっくり斬り殺した。",
      "translatedEnglishLine": "Rance slashed the man down cleanly."
    },
    {
      "lineNumber": 10791,
      "originalJapaneseLine": "「きゃっ……！」",
      "translatedEnglishLine": "\"Kya...!\""
    },
    {
      "lineNumber": 10792,
      "originalJapaneseLine": "「クズは滅びた。よーしお姉さん。俺と……」",
      "translatedEnglishLine": "\"Trash is eliminated. Alright, miss. Let’s...\""
    },
    {
      "lineNumber": 10793,
      "originalJapaneseLine": "「ひっ……た、助けてっ……！」",
      "translatedEnglishLine": "\"Eek... Help me...!\""
    },
    {
      "lineNumber": 10794,
      "originalJapaneseLine": "女性は駆け去って行ってしまった。",
      "translatedEnglishLine": "The woman ran away."
    },
    {
      "lineNumber": 10795,
      "originalJapaneseLine": "「ちっ、殺し損か。まあいい」",
      "translatedEnglishLine": "\"Tch, a failed kill. Oh well.\""
    },
    {
      "lineNumber": 10796,
      "originalJapaneseLine": "ランスは剣を収めて、また歩き出す。",
      "translatedEnglishLine": "Rance sheathed his sword and started walking again."
    },
    {
      "lineNumber": 10797,
      "originalJapaneseLine": "「こっ、殺しやがった……あっさりと……」",
      "translatedEnglishLine": "\"H-He actually killed him... just like that...\""
    },
    {
      "lineNumber": 10798,
      "originalJapaneseLine": "「そーとーさま！」",
      "translatedEnglishLine": "\"Sotoo-sama!\""
    },
    {
      "lineNumber": 10799,
      "originalJapaneseLine": "「む……あと十年。なんだ、ガキ」",
      "translatedEnglishLine": "\"Hmm... Ten more years. What is it, kid?\""
    },
    {
      "lineNumber": 10800,
      "originalJapaneseLine": "「おかーさんが、いつもありがとうって！",
      "translatedEnglishLine": "\"Mom always says thank you!\""
    }
  ]
}

